```json
{
  "application": "iperf",
  "details": {
    "slurm_script": true,
    "slurm_options": [
      {
        "option": "--time",
        "value": "20"
      }
    ],
    "command": "srun iperf -s"
  }
}
```

**Explanation:**

* **Application:** `iperf` is a network performance measurement tool.
* **Details:**
    * **slurm_script:** This script is designed to be run with the Slurm workload manager.
    * **slurm_options:** The script uses the `--time` option to set a maximum runtime limit of 20 minutes (20 units of Slurm's time format).
    * **command:** `srun iperf -s` is the actual command executed by Slurm. It starts the `iperf` server in the background.
